import {NavLink} from 'react-router-dom';
import styles from './Header.module.css';
const Header = () => {
    return <header className={styles["main-header"]}>
                <div className={styles.brand}>CRM</div>
                <div className={styles.navigation}><NavLink activeClassName={styles.active} to="/home">Home</NavLink></div>
                <div className={styles.navigation}><NavLink activeClassName={styles.active} to="/leads">Leads</NavLink></div>
                <div className={styles.navigation}><NavLink activeClassName={styles.active} to="/contacts">Contacts</NavLink></div>
            </header>
}

export default Header;
